import React from "react";
import { StatusBar } from 'expo-status-bar';
import { StyleSheet,SafeAreaView,Text, View, TextInput } from 'react-native';

export default function App() {
  const [adicionar, setAdicionar] = React.useState()

  return (
    <SafeAreaView style={styles.container}>
      <View style={{backgroundColor:"#05F69D"}}>
 <Text style={styles.title}>Plano Diarias</Text>
 </View>
 <View style={styles.container1}>
 <TextInput placeholder="Adicionar"
style={styles.input} value={adicionar} onChangeText={setAdicionar} />  
 </View>
 <StatusBar style="auto" />
    </SafeAreaView>


  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
  },
  title:{
    fontSize:30,
    marginTop:40,
    marginBottom:30,
    textAlign:"center",
  },
  container1:{
   fontSize:30,
   padding:20,
   marginTop:30,
   marginBottom:30,

  },
});
